import React from 'react';
import { NavLink } from 'react-router-dom';
import img1 from "../Assets/BlackSideMenu.png";

const Sidebar = () => {
  return (

    <nav
      style={{
        fontFamily: 'Inter, sans-serif', // Font family
        fontWeight: 600, // Font weight
        fontSize: '16px', // Font size
        lineHeight: '20px', // Line height
      }}
    >
      <ul className="space-y-2">

        <li>
          <img src={img1} style={{ float: "left", height: "30px", width: "30px", padding: "5px", marginTop: "5px" }} />
          <NavLink
            to="/"
            className={({ isActive }) =>
              `block py-2 px-4 ${isActive ? 'text-[#6941C6]' : 'hover:bg-gray-300'
              }`
            }
          >
            Overview
          </NavLink>
        </li>
        <li>
          <NavLink
            to="/page1"
            className={({ isActive }) =>
              `block py-2 px-4 ${isActive ? 'text-[#6941C6]' : 'hover:bg-gray-300'
              }`
            }
          >
            People Directory
          </NavLink>
        </li>
      </ul>
    </nav>
  );
};

export default Sidebar;
